export function createNodeHandlers(initialNodes) {
  let nodes = initialNodes;
  const listeners = [];

  const onNodesChange = (callback) => {
    const listener = (currentNodes) => callback(currentNodes);
    listeners.push(listener);
    listener(nodes); // immediate invocation with current state
    return () => {
      const index = listeners.indexOf(listener);
      if (index !== -1) {
        listeners.splice(index, 1);
      }
    };
  };

  const setNodes = async (updaterOrNodes) => {
    const newNodes = typeof updaterOrNodes === 'function' 
      ? updaterOrNodes(nodes) 
      : updaterOrNodes;
    nodes = newNodes;
    const promises = listeners.map(listener => {
      try {
        const result = listener(nodes);
        return result instanceof Promise ? result : Promise.resolve(result);
      } catch (error) {
        console.error(error);
        return Promise.resolve();
      }
    });
    await Promise.all(promises);
  };

  return { onNodesChange, setNodes };
}

export function createNodeHandlers(initialNodes) {
  let currentNodes = initialNodes;

  const setNodes = (updater) => {
    if (typeof updater === 'function') {
      currentNodes = updater(currentNodes);
    } else {
      currentNodes = updater;
    }
  };

  const onNodesChange = (changes) => {
    setNodes((nodes) => applyNodeChanges(changes, nodes));
  };

  return { onNodesChange, setNodes };
}

